INSERT INTO `abelhas` VALUES (1,1,'Jatai','Tetragonista Angustula','5 mil abelhas',1.0,'4',1.2,'A Tetragonisca angustula, também chamada jataí-amarela, abelha-ouro, jati, abelha-mirim, mosquitinha-verdadeira, sete-portas, três-portas, abelha de botas e minguinho é uma abelha social da subfamília dos meliponíneos, de ampla distribuição no Brasil.\r\n\r\nApresenta cabeça e tórax pretos, abdômen escuro e pernas pardacentas. Mede até quatro milímetros de comprimento. Constrói ninhos de cera em espaços ocos na natureza. A entrada do ninho tem o formato de um dedo de luva e é, geralmente, ramificada (motivo pela qual a espécie também é chamada \"sete-portas\" e \"três-portas\"), a qual fecha quando se aproxima algum perigo, como uma abelha iratim ou uma formiga.\r\n\r\nTem o hábito de morder a roupa das pessoas e de se enroscar nos cabelos se for provocada, mas não tem ferrão, sendo considerada uma abelha dócil e de fácil manejo pelos meliponicultores. Produz mel claro, de aroma suave e muito valorizado, porém escasso.','https://pt.wikipedia.org/wiki/Tetragonisca_angustula','https://api.abelhasbrasil.com.br/upload/abelhas/1.jpg?c=f7c4dfdef8e50cd22621164cf95efbd1','2020-06-28 23:50:15','2020-06-28 23:50:15',NULL),(2,2,'Mandaçaia MQQ','Melipona Quadrifasciata Quadrifasciata','400 a 600 abelhas',2.5,'20',2.0,'Melipona quadrifasciata também chamada de Mandaçaia (palavra indígena que significa vigia bonito) é uma abelha social brasileira, da tribo Meliponini. A espécie mede de 10 mm a 11 mm de comprimento com o corpo mais robusto e volumoso que o das abelhas comuns do gênero Apis, tendo a cabeça e tórax pretos, abdome com faixas amarelas e asas ferrugíneas. Constrói seus ninhos dentro de cavidades existentes nos troncos ou galhos das árvores. Também é conhecida pelos nomes de amanaçaí, amanaçaia, manaçaia e mandaçaia-grande.','https://pt.wikipedia.org/wiki/Melipona_quadrifasciata','https://api.abelhasbrasil.com.br/upload/abelhas/2.jpg?c=9d2191f9fc00ea4aeb605646943ee530','2020-11-04 13:32:03','2020-11-04 13:32:03',NULL),(3,3,'Plebeia Droryana','Plebeia Droryana','',0.0,'20',0.0,'A Plebeia droryana, também chamada de abelha-mosquito, mirim, jataí-mosquito, jataí-preta, jati e jati-preta. é uma abelha social sem ferrão, da familia Apidae e tribo Meliponini de ampla distribuição no Brasil. A espécie possui coloração escura com desenhos amarelos e cerca de 3 mm de comprimento, nidificando em fendas de árvores ocas e buracos nas rochas ou muros. São inteiramente mansas, cujos ninhos são encontrados em diversos lugares, sendo que utilizam desde árvores até barrancos, desde que os ocos sejam de tamanho apropriado e não aquecidos pelo sol em demasia. A entrada do ninho é feita por um acesso geralmente pequeno na parte exterior elaborado com própolis, não sendo fechada à noite diferente de outras espécias. Os favos de cria são horizontais ou helicoidais e ocorrem células reais.[1] O invólucro está presente nos favos de cria e é construído com cerume.[2] As colônias podem ser constituídas por 2.000 a 3.000 abelhas (Lindauer & Kerr, 1960). A construção dos favos de cria é suspensa no inverno ou em uma parte dele no Estado de São Paulo.[2] Nesta espécie, ocorrem machos normais e gigantes, ambos são tratados da mesma maneira pelas operárias.[3] A Plebeia droryana produz um mel apreciado, porém escasso.','https://pt.wikipedia.org/wiki/Plebeia_droryana','https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-24 18:37:40','2020-04-24 18:37:40',NULL),(4,NULL,'Mirim Nigriceps','Plebeia Nigriceps',NULL,NULL,NULL,NULL,'','https://www.embrapa.br/','https://api.abelhasbrasil.com.br/upload/abelhas/4.jpg?c=3b602bb471880f3abc8ed4cb31417402','2020-04-17 12:51:03','2020-04-17 12:51:03',NULL),(5,3,'Borá','Tetragona clavipes',NULL,NULL,NULL,NULL,'Abelha da família dos Meliponídeos, seu nome original vem do Tupi Heborá, que significa: o que há de ter mel. Já popularmente, a Tetragona clavipes é conhecida como Jataizão, Vorá e Cola-Cola. Também é conhecida pelos índios da Reserva do Xingu, onde é encontrada em abundância. Os índios Yudja a conhecem como Watawila; os Ikipeng ( Kticao), como Amputxigagem; os Suiá, como Simbretx; e os Kaibi, como Tapemon. Diz a lenda que Borá  é uma substância amarela e amarga encontrada nos ninhos dessa abelha, possivelmente por se notar grande quantidade de samora, saburá (pólen), armazenada por esta abelha.\r\n\r\nA Borá é uma abelha sem ferrão bastante agressiva, principalmente nas horas quentes do dia, quando se defende, valentemente, mordiscando a pele ou se enrolando nos cabelos de quem se atreve a chegar perto de sua colmeia. Apresenta deposição de própolis como comportamento defensivo. Nidifica em ocos de árvores, de preferência, vivas. Na região do Rio Xingu e Suiá missu, há grande quantidade de ninhos em Pequizeiros (Pequi).\r\n\r\nOcorrência\r\n\r\nA abelha Borá é encontrada no Acre, no Amazonas, no Amapá, na Bahia, no Espírito Santo, em Goiás, no Maranhão, em Minas Gerais, no Mato Grosso do Sul, no Mato Grosso, no Pará, no Paraná, no Rio de Janeiro e em São Paulo.','https://www.cpt.com.br/cursos-criacaodeabelhas/artigos/abelhas-sem-ferrao-bora-tetragona-clavipes','https://api.abelhasbrasil.com.br/upload/abelhas/5.jpg?c=1e5a433954d3d56d72722e03d41d89c9','2020-06-28 23:51:08','2020-06-28 23:51:08',NULL),(6,NULL,'Canudo','Scaptotrigona Depilis','2 mil a 50 mil abelhas',1.0,'20',3.0,'Abelhas Canudo são abelhas bastante defensivas e possuem a entrada da colmeia em forma de canudo que da o nome popular a Scaptotrigona Depilis.\r\n\r\nOnde encontrar abelhas Canudo\r\nAs abelhas Canudo são encontradas nos estados: Mato Grosso do Sul, Minas Gerais, Paraná, Rio Grande do Sul, São Paulo.\r\n\r\nAbelhas Canudo – Morfologia\r\nAs abelhas Canudo possuem abdome totalmente preto sem listras e azas marrons.','https://www.criarabelhas.com.br/abelhas-canudo/','https://api.abelhasbrasil.com.br/upload/abelhas/6.jpg?c=2d5adc85f42c21d9f37672fc9e61ecdf','2020-06-28 23:51:45','2020-06-28 23:51:45',NULL),(7,NULL,'Abelha italiana','Apis mellifera ligustica','90 mil a 150 mil abelhas',3.0,NULL,NULL,NULL,NULL,'https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:33','2020-04-17 12:35:33',NULL),(8,NULL,'Abelha europeia','Apis mellifera',NULL,NULL,NULL,NULL,NULL,'','https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:34','2020-04-17 12:35:34',NULL),(9,NULL,'Abelha africanizada','A. m. scutellata x A. m. ligustica x A. m. mellifera x A. m. carnica',NULL,NULL,NULL,NULL,'A abelha africanizada ou abelha do mel africanizado, também conhecida coloquialmente como \"abelha assassina\", é uma híbrida de espécies ocidentais de abelha (Apis mellifera) com abelhas africanas (A. m. Scutellata). São produzidas originalmente por cruzamento da abelha africana, com abelhas europeias, como a abelha italiana (A. m. Ligustica) e a abelha ibérica (A. m. Iberiensis).\r\n\r\nA abelha africanizada foi criada e introduzida pela primeira vez no Brasil na década de 1950, em um esforço para aumentar a produção de mel, mas em 1957, 26 enxames escaparam acidentalmente da quarentena. Desde então, a nova espécie híbrida se espalhou por toda a América do Sul e chegou à América do Norte em 1985. Várias colmeias da espécie foram encontradas no sul do estado americano do Texas em 1990.[1]\r\n\r\nAs abelhas africanizadas geralmente são muito mais defensivas que as outras espécies de abelha e reagem a perturbações muito mais rapidamente do que as abelhas ocidentais. Elas podem perseguir uma pessoa a mais de 400 metros, e já mataram cerca de 1000 pessoas, as vitimas geralmente recebem dez vezes mais picadas que nos ataques de abelhas europeias.[2] Elas também já foram responsáveis por matarem cavalos e outros animais.','https://pt.wikipedia.org/wiki/Abelha_africanizada','https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:36','2020-04-17 12:35:36',NULL),(10,NULL,'Manduri do Mato Grosso',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:36','2020-04-17 12:35:36',NULL),(11,NULL,'Mandaguari',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:37','2020-04-17 12:35:37',NULL),(12,NULL,'Tiúba','Melipona compressipes',NULL,NULL,NULL,NULL,'Melipona compressipes também chamada de tiúba ou uruçu-cinzenta é uma espécie de abelha sem ferrão largamente criada no norte dos estados do Pará Maranhão e Piauí',NULL,'https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:38','2020-04-17 12:35:38',NULL),(13,NULL,'Lambe Olhos','Leurotrigona muelleri',NULL,NULL,NULL,NULL,NULL,'https://pt.wikipedia.org/wiki/Melipona_compressipes','https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-09-21 19:09:42','2020-09-21 19:09:42',NULL),(14,NULL,'Mandaçaia MQA','Melipona Quadrifasciata Anthidioloides','400 a 600 abelhas',2.5,'20',2.0,NULL,NULL,'https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:39','2020-04-17 12:35:39',NULL),(15,NULL,'Manduri','Melipona marginata',NULL,NULL,NULL,NULL,'Melipona marginata é uma espécie de abelha social da tribo Meliponini. As abelhas desse grupo são conhecidas pelo comportamento social e pelo ferrão atrofiado. São popularmente conhecidas como abelhas sem ferrão e estão amplamente distribuídas pelos trópicos e subtrópicos. Melipona marginata é considerada uma das espécies do gênero Melipona mais sensíveis aos processos de degradação e fragmentação dos hábitats, sendo considerada “exigente em relação ao tamanho e/ou qualidade desses fragmentos, não ocorrendo a não ser nos maiores, mais antigos e menos perturbados.” [1]\r\n\r\nPossui nome popular de manduri, manduri menor, minduri, gurupu do miúdo ou taipeira.[2] As operárias têm cerca de 6 a 7 mm de comprimento e coloração acinzentada ou preta. As colônias são levemente povoadas, com aproximadamente 300 indivíduos adultos.\r\n\r\nDe acordo com Kerr (1948), M. marginata é uma espécie excepcional pois a taxa de produção de rainhas é muito maior do que em outras espécies de abelhas do gênero Melipona, podendo chegar a 25% do total de fêmeas produzidas em uma colônia.\r\n\r\nDevido às semelhanças dos caracteres morfológicos, Melipona marginata e Melipona obscurior foram consideradas duas subespécies de Melipona marginata, sendo a separação proposta por Camargo & Pedro em 2007[3]. Assim, M. obscurior é um status novum de M. marginata obscurior, e pode ser considerada uma espécie estreitamente relacionada com M. marginata, tanto no tamanho corporal quanto no comportamento de diapausa reprodutiva facultativa apresentado pelas rainhas nos meses de encurtamento do fotoperíodo. [4][5] A espécie M. marginata está distribuída pelos estados de São Paulo, Rio de Janeiro, Minas Gerais, Bahia, Pernambuco, Ceará e Goiás, enquanto M. obscurior pode ser encontrada nos estados de São Paulo, Santa Catarina, Paraná, Mato Grosso e Rio Grande do Sul.[3]','https://pt.wikipedia.org/wiki/Melipona_marginata','https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:39','2020-04-17 12:35:39',NULL),(16,NULL,'Mirim Preguiça','Friesella Schrottkyi',NULL,NULL,NULL,NULL,NULL,NULL,'https://api.abelhasbrasil.com.br/imgs/sem-foto.jpg','2020-04-17 12:35:40','2020-04-17 12:35:40',NULL);
