INSERT INTO `artigos` VALUES (1,'EFEITO DE INSETICIDA EM PLEBEIA DRORYANA','<p>As abelhas sem ferr&atilde;o s&atilde;o eficientes polinizadores em diversas culturas agr&iacute;colas. Essas culturas, frequentemente, s&atilde;o danificadas por pragas, que s&atilde;o controladas principalmente por inseticidas. O uso excessivo desses produtos, comumente associado a pr&aacute;ticas inadequadas, contribui para que res&iacute;duos desses agrot&oacute;xicos sejam levados para as col&ocirc;nias, pelas abelhas forrageiras, e quando presentes no alimento larval podem prejudicar o desenvolvimento dos imaturos.</p>','https://ainfo.cnptia.embrapa.br/digital/bitstream/item/169483/1/2017MICp34.pdf','Inseticidas','abelhas nativas, agrotóxicos, polinizadores','Caroline Cozer Vicari1\r\n; Andressa Linhares Dorneles2\r\n; Charles Fernando dos Santos3\r\n;\r\nBetina Blochtein4\r\n; Alberto Luiz Marsaro Júnior5',1,'0000-00-00 00:00:00','2020-04-11 21:27:34',NULL),(2,'AÇÕES DE EDUCAÇÃO AMBIENTAL EM MELIPONICULTURA','<p><span style=\"font-size:14px\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span> &nbsp; A meliponicultura<strong>, cria&ccedil;&atilde;o de abelhas nativas sem ferr&atilde;o,</strong> desperta muito interesse em diversos segmentos da sociedade, por estar relacionada &agrave; sustentabilidade nos &acirc;mbitos social, econ&ocirc;mico e ambiental. Al&eacute;m disso, <strong>utiliza-se as abelhas ind&iacute;genas sem ferr&atilde;o como instrumento did&aacute;tico, pois estes insetos atraem a aten&ccedil;&atilde;o e estimulam a curiosidade de crian&ccedil;as, adolescentes e adultos</strong>. No per&iacute;odo de dezembro de 2014 a 2017, foram realizadas visitas, cursos e exposi&ccedil;&otilde;es relacionados ao tema ―Meliponicultura e Educa&ccedil;&atilde;o Ambiental‖, com o objetivo de utilizar as abelhas sem ferr&atilde;o para conscientiza&ccedil;&atilde;o ambiental e disseminar a <strong>meliponicultura como alternativa de renda para agricultores</strong>. Essas atividades aconteceram em v&aacute;rios munic&iacute;pios do Par&aacute; e em outros estados. As atividades realizadas pelo projeto tiveram um bom alcance, atingindo quase 5000 pessoas, durante os quatro anos de realiza&ccedil;&atilde;o.<strong> As abelhas sem ferr&atilde;o se mostraram uma importante ferramenta de conscientiza&ccedil;&atilde;o ambiental</strong>, atingindo p&uacute;blico de diversos perfis. Crian&ccedil;as e estudantes de ensino superior foram alguns dos p&uacute;blicos mais frequentes nessas atividades, demonstrando o potencial do projeto em despertar o interesse pela ci&ecirc;ncia e contribuir com a forma&ccedil;&atilde;o dos futuros profissionais da &aacute;rea, preenchendo uma importante lacuna dos cursos de gradua&ccedil;&atilde;o do estado. <strong>A divulga&ccedil;&atilde;o da atividade de cria&ccedil;&atilde;o dessas abelhas (meliponicultura) tamb&eacute;m contribui para a conserva&ccedil;&atilde;o do ambiente</strong>.</p>','https://ainfo.cnptia.embrapa.br/digital/bitstream/item/171261/1/anais-tcompleto-simposio-2017-volume-1-02.pdf','Meliponicultura','Meliponicultura. Educação Ambiental. Abelhas.','Ana Carolina Martins de Queiroz1\r\n; Janete Teixeira Gomes2\r\n; Maria Carmelita Alves Conceição3\r\n; Jamille Costa\r\nVeiga1\r\n;\r\n Kamila Leão Leão4\r\n; Cristiano Menezes 5\r\n1Mestre em Ciências Biológicas (Zoologia). Embrapa Amazônia Oriental. carolina.queiroz@embrapa.br.\r\n2 Bacharel em Gestão Ambiental. Embrapa Amazônia Oriental.jan_teixeiragomes@yahoo.com\r\n3 Mestre em Botânica. Embrapa Amazônia Oriental. maria.conceicao@embrapa.br\r\n4 Mestre em Ciência Animal. Embrapa Amazônia Oriental. kamilabelha@gmail.com\r\n5 Doutor em Entomologia. Embrapa Amazônia Oriental. cristiano.menezes@embrapa.br',1,'2020-04-03 20:48:07','2020-04-11 21:26:51',NULL),(3,'MELIPONICULTURA','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;A <strong>meliponicultura</strong> &eacute; a cria&ccedil;&atilde;o racional de abelhas do grupos dos meliponineos, por essas abelhas&nbsp; apresentam ferr&atilde;o n&atilde;o desenvolvido, dispensa material de prote&ccedil;&atilde;o para fazer o manejo.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;As abelhas sem ferr&atilde;o fazem parto do grupos dos melipon&iacute;neos tamb&eacute;m chamadas de abelhas ind&iacute;genas ou nativas. Essas abelhas ja existiam na &Aacute;merica do Sul, muito antes do descobrimento e eram criadas e exploradas pelos ind&iacute;genas principalmento no Brasil e no M&eacute;xico. No Mundo, existem mais de 20.000 esp&eacute;cies, sendo que cerca de 400 s&atilde;o encontradas no Brasil, as quais podem ser classificadas em dois, <strong>Tribo Meliponini e Tribo Trigonini</strong>.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;O ninho das abelhas sem ferr&atilde;o &eacute; de tamanho <strong>vari&aacute;vel &agrave; esp&eacute;cie</strong>,&nbsp;composto basicamento por dois tipos de materiais: <strong>cerume e&nbsp;geopr&oacute;polis</strong>, cada um desses ter&aacute; uma destina&ccedil;&atilde;o espec&iacute;fica para o tipo de estrutura constru&iacute;da&nbsp;no ninho. Entretanto as entradas podem variar de uma esp&eacute;cie para a outra, e s&atilde;o constru&iacute;das nos mais diversos tipos de materiais como cera e resina, barro e resina, com isso &eacute; poss&iacute;vel caracterizar a esp&eacute;cie pelo meterial usado na constru&ccedil;&atilde;o da entrada do ninho.</p>','https://ainfo.cnptia.embrapa.br/digital/bitstream/item/200132/1/Cartilha-Meliponicultura-FINAL2016corelX5-final2-curvas.pdf','Meliponicultura',NULL,'Equipe Técnica de Elaboração: José Fernandes Neto - Eng. Agrônomo EBDA, Eva Mônica Sarmento - Zootecnista UNIVASF, Rebert Coelho Correia - Embrapa Seminário, Tania Maria Sarmento da Silva - Universidade Federal Rural de Pernanbuco\r\nColaboração: Paulo Pereira da Silva Filho - Embrapa Seminário',1,'2020-04-03 22:05:24','2020-04-11 21:26:06',NULL),(4,'Valor nutricional do mel e pólen de abelhas sem ferrão da região amazônica','<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:13.192px\"><span style=\"color:#000000\"><span style=\"font-family:verdana,arial\"><span style=\"background-color:#ffffff\"><span style=\"font-family:VERDANA\"><span style=\"font-size:small\">Avaliou-se os<strong> constituintes nutricionais de amostras do mel e p&oacute;len</strong> das&nbsp;<em>esp&eacute;cies Melipona seminigra merrillae</em>&nbsp;(janda&iacute;ra),&nbsp;<em>Melipona compressipes manaosensis</em>&nbsp;(jupar&aacute;),&nbsp;<em>Melipona rufiventris paraensis</em>&nbsp;(uru&ccedil;u boca de ralo), provenientes do melipon&aacute;rio da Fazenda Poranga no munic&iacute;pio de Itacoatiara - AM e Melipon&aacute;rio Abelhudo em Manaus&nbsp;<em>&ndash;&nbsp;</em>AM.<strong> Os resultados demonstraram o potencial do mel como fonte de energia</strong>, particularmente a&nbsp;<em>M. rufiventris</em>&nbsp;com 305,3&plusmn;2,4 kcal em 100g. O p&oacute;len da esp&eacute;cie&nbsp;<em>M. compressipes</em>&nbsp;<strong>apresentou a maior concentra&ccedil;&atilde;o de prote&iacute;na</strong> 15,7&plusmn;0,0% e<strong> energia</strong> 309,8&plusmn;0,8 kcal. Tais constata&ccedil;&otilde;es sugerem a implementa&ccedil;&atilde;o de novos estudos visando &agrave; incorpora&ccedil;&atilde;o destes produtos na dieta dos amaz&ocirc;nidas, possibilitando uma nova fonte alternativa de alimento potencialmente nutritivo e saud&aacute;vel.</span></span></span></span></span></span></p>','http://www.scielo.br/pdf/aa/v34n2/v34n2a20.pdf','Nutrição','mel, pólen, energia, proteína, lipídio','Rosa Cristina da Silva SOUZA1\r\n, Lucia Kiyoko Ozaki YUYAMA2\r\n Jaime Paiva Lopes AGUIAR3\r\n, Francisco Plácido\r\nMagalhães OLIVEIRA.4',1,'2020-04-09 17:14:37','2020-04-11 21:20:42',NULL),(5,'MELIPONICULTURA E SEUS DESAFIOS: proposta de uma nova alternativa com sustentabilidade.','<p>Este trabalho teve por <strong>objetivo uma proposta de como fomentar a cria&ccedil;&atilde;o de abelhas sem ferr&atilde;o</strong>, atividade conhecida como<strong> Meliponicultura</strong>, na regi&atilde;o do extremo oeste de Santa Catarina. Tamb&eacute;m foi foco do estudo a cria&ccedil;&atilde;o da Associa&ccedil;&atilde;o dos Meliponicultores da regi&atilde;o, foi poss&iacute;vel tamb&eacute;m, durante a elabora&ccedil;&atilde;o do trabalho, identificar benef&iacute;cios e <strong>vantagens da Meliponicultura bem como a implanta&ccedil;&atilde;o de uma propriedade modelo para a atividade</strong>. Buscou-se refer&ecirc;ncias bibliogr&aacute;ficas dos mais variados autores, em sites e livros o que, com certeza, evidencia e esclarece poss&iacute;veis d&uacute;vidas que possam surgir ao leitor durante a leitura do presente artigo sobre a meliponicultura, um termo relativamente novo e pouco conhecido pela sociedade. Foi realizada uma pesquisa aplicando-se um <strong>question&aacute;rio para 42 moradores dos munic&iacute;pios acima j&aacute; citados</strong> para se identificar a situa&ccedil;&atilde;o da meliponicultura na regi&atilde;o, e convidou-se 09 meliponicultores para a primeira reuni&atilde;o a fim de criar uma associa&ccedil;&atilde;o regional para a atividade dando in&iacute;cio &agrave;s discuss&otilde;es para sua implanta&ccedil;&atilde;o. A pesquisa caracterizou-se por um estudo quantitativo e qualitativo, de car&aacute;ter explorat&oacute;rio, utilizando-se de um levantamento de dados. A coleta de dados ocorreu na propriedade rural do Sr. Blasio Spaniol situada na Linha Novo Encantado, munic&iacute;pio de Bandeirante, SC. V&aacute;rias atividades foram realizadas na propriedade do Sr. Blasio Spaniol entre elas ,<strong> plantio de esp&eacute;cies da flora, limpeza e prote&ccedil;&atilde;o das mesmas, manuten&ccedil;&atilde;o de colm&eacute;ias de abelhas, divis&atilde;o e multiplica&ccedil;&atilde;o de enxames, repovoamento da flora local, planejamento da propriedade em setores , instala&ccedil;&atilde;o dos melipon&aacute;rios com colm&eacute;ias de diversas esp&eacute;cies de abelhas sem ferr&atilde;o</strong>. Foi percept&iacute;vel o entusiasmo e satisfa&ccedil;&atilde;o do propriet&aacute;rio para com as ASFs (abelhas sem ferr&atilde;o), de tal forma que contagiou os autores deste trabalho. <strong>Pode-se perceber que com uma boa Gest&atilde;o Ambiental muito pode ser feito em prol da atividade da Meliponicultura</strong> na regi&atilde;o do extremo oeste de Santa Catarina, pois com a associa&ccedil;&atilde;o concretizada, identificando e buscando-se mais pessoas exercendo a atividade e tendo uma propriedade modelo implantada servindo de refer&ecirc;ncia e suporte t&eacute;cnico &eacute; bem prov&aacute;vel o &ecirc;xito da atividade em <strong>alcan&ccedil;ar bons frutos e quem sabe possibilitar uma renda adicional al&eacute;m do prazer de estar promovendo um trabalho de sustentabilidade ambiental.</strong></p>','http://www.uniedu.sed.sc.gov.br/wp-content/uploads/2015/02/Artigo-Thiago-Andr%C3%A9-Rauber.pdf','Meliponicultura','Sustentabilidade ambiental. Meliponicultura. ASFs (abelhas sem ferrão). Gestão Ambiental. Meliponicultores.','Thiago André Rauber1\r\nProfessor Orientador: Alceu Cericato2',1,'2020-04-09 17:34:11','2020-04-11 21:19:39',NULL),(6,'Captura de enxames de abelhas sem ferrão (Hymenoptera, Apidae, Meliponinae) sem destruição de árvores','<p style=\"text-align:start\"><span style=\"font-size:13.192px\"><span style=\"color:#000000\"><span style=\"font-family:verdana,arial\"><span style=\"background-color:#ffffff\"><span style=\"font-family:Verdana,Arial,Helvetica,sans-serif\"><span style=\"font-size:small\">No Brasil a cria&ccedil;&atilde;o racional de abelhas sem ferr&atilde;o &eacute; denominada meliponicultura. As abelhas sem ferr&atilde;o possuem diferentes comportamentos de nidifica&ccedil;&atilde;o, com <strong>ninhos internos (cavidades naturais ou n&atilde;o) e externos</strong>. Um dos <strong>principais problemas apresentados na meliponicultura &eacute; a captura de uma col&ocirc;nia com o objetivo de iniciar um melipon&aacute;rio sem &quot;destruir as &aacute;rvores&quot;</strong> ou mesmo <strong>as pr&oacute;prias col&ocirc;nias durante a captura</strong>. O presente trabalho apresenta um <strong>m&eacute;todo alternativo para captura de col&ocirc;nias de abelhas sem ferr&atilde;o</strong>, especialmente, do g&ecirc;nero&nbsp;<em>Melipona</em>&nbsp;Illiger, 1806, que s&atilde;o as esp&eacute;cies mais utilizadas para produ&ccedil;&atilde;o de mel e p&oacute;len, na regi&atilde;o Amaz&ocirc;nica. O m&eacute;todo consiste em abrir uma janela na &aacute;rvore, coletar o material e fechar a abertura utilizando a resina vegetal conhecida como breu.</span></span></span></span></span></span></p>','http://www.scielo.br/pdf/aa/v35n3/v35n3a11.pdf','Sustentabilidade','Coleta de enxames, meliponicultura, Melipona sp, ninhos, resinas vegetais.','Alexandre COLETTO-SILVA',1,'2020-04-09 17:41:13','2020-04-11 21:19:12',NULL),(7,'POTENCIAL ANTIMICROBIANO DE PRÓPOLIS E CERA DE DIFERENTES ESPÉCIES DE ABELHAS SEM FERRÃO','<p>O <strong>objetivo de avaliar a atividade antimicrobiana de pr&oacute;polis e cera de diferentes esp&eacute;cies de abelhas sem ferr&atilde;o frente &agrave;s bact&eacute;rias patog&ecirc;nicas</strong>. Foram colhidas ceras de abelhas Canudo (<em>Scaptotrigona sp</em>.), Janda&iacute;ra (<em>Melipona subnitida</em>) e Jati (<em>Pleb&eacute;ia sp.</em>) e&nbsp;duas amostras das esp&eacute;cies de pr&oacute;polis Cupira (<em>Partamona sp</em>.) e Jati (<em>Plebl&eacute;ia sp.</em>). Para a an&aacute;lise da atividade antimicrobiana de cera e pr&oacute;polis <strong>em extratos hidroalco&oacute;licos foram produzidas concentra&ccedil;&otilde;es de 100, 75 e 50 &mu;g / mL-1 </strong>e <strong>utilizados t&eacute;cnica de disco-difus&atilde;o</strong>. Para avaliar a atividade antimicrobiana dos extratos foram utilizadas as linhagens <em>Enterobacter aerogenes</em> (ATCC 1304), <em>Escherichia coli</em> (ATCC 25922) e <em>Staphylococcus aureus</em> (ATCC 6538).<strong> Observou-se que os extratos de cera de abelhas Canudo e Janda&iacute;ra Jati</strong> apresentaram atividade contra os microrganismos testados. Quanto <strong>aos extratos de pr&oacute;polis, verificou-se que a concentra&ccedil;&atilde;o de Cupira</strong> de 100 &mu;g / mL-1 tinha atividade contra todas as cepas bacterianas testadas, como em outras concentra&ccedil;&otilde;es, apenas <em>Staphylococcus aureus</em> inibiu seu crescimento. O extrato de Jatipropolis inibiu as bact&eacute;rias<em> Enterobacter aerogenes</em> e <em>Staphylococcus aureus</em> em uma concentra&ccedil;&atilde;o de 100 &mu;g / mL-1 e E. colis n&atilde;o sofreu inibi&ccedil;&atilde;o. <strong>Portanto, os extratos de cera e pr&oacute;polis das esp&eacute;cies de abelhas avaliadas t&ecirc;m potencial antimicrobiano contra cepas de microorganismos testados</strong>.</p>','https://periodicos.ufersa.edu.br/index.php/acta/article/view/5406/5861','Produtividade','uso terapêutico; ação antimicrobiana; extrato.','Maria  Carla  da  Silva  Campêlo1*,  Débora  Alves  de  Carvalho  Freire1,  Maria  Rociene Abrantes1,  Êlika Suzianny de Sousa2, Jean Berg Alves da Silva3',1,'2020-04-09 19:29:50','2020-04-11 21:17:24',NULL),(8,'Variabilidade Química de Geoprópolis Produzida pelas Abelhas sem Ferrão Jataí, Mandaçaia e Mandurí','<p>As abelhas sem ferr&atilde;o (melipon&iacute;neos) s&atilde;o popularmente conhecidas como <strong>abelhas nativas e destacam-se como importantes polinizadores de v&aacute;rias culturas agr&iacute;colas</strong>. As <strong>col&ocirc;nias de abelhas sem ferr&atilde;o s&atilde;o comercializadas com fins ornamentais e ambientais</strong>. O mel produzido por esses insetos apresenta sabor peculiar, sendo vendido a valores superiores que o mel de<em> Apis mellifera</em>. As abelhas sem ferr&atilde;o <strong>produzem a geopr&oacute;polis que &eacute; constitu&iacute;da por resina vegetal misturada a terra e/ou barro</strong>. Apesar da crescente import&acirc;ncia econ&ocirc;mica da meliponicultura, ainda s&atilde;o escassos os estudos relacionados aos produtos da colmeia de melipon&iacute;neos. No presente estudo s&atilde;o comparadas a composi&ccedil;&atilde;o qu&iacute;mica, qualitativa e quantitativa, e a capacidade antirradicalar de geopr&oacute;polis coletadas em melipon&aacute;rios da regi&atilde;o de Prudent&oacute;polis, Paran&aacute;. O estudo foi baseado na determina&ccedil;&atilde;o de par&acirc;metros <strong>quantitativos, como os teores de fen&oacute;is totais, os teores de flavonoides, bem como a capacidade antirradicalar dos extratos de geopr&oacute;polis</strong>. Tamb&eacute;m foram comparados os perfis de dados espectrais por UV-Vis e Espectrometria de Massas com Ioniza&ccedil;&atilde;o por Eletrospray (ESI-MS) obtidos para os diferentes extratos. Atrav&eacute;s de UPLC-MS/MS foi poss&iacute;vel identificar 12 componentes da geopr&oacute;polis. Ao mesmo tempo, foi avaliada a variabilidade qu&iacute;mica da geopr&oacute;polis em fun&ccedil;&atilde;o da esp&eacute;cie de abelha produtora (<em>Tetragonisca angustula</em> (Latreille), <em>Melipona quadrifasciata quadrifasciata</em> (Lepeletier) e <em>Melipona marginata</em> (Lepeletier)) e da &eacute;poca da coleta para uma mesma regi&atilde;o geogr&aacute;fica utilizando-se ferramentas estat&iacute;sticas, como a An&aacute;lise de Vari&acirc;ncia (ANOVA) e a an&aacute;lise multivariada (An&aacute;lise das Componentes Principais, ACP). <strong>A ANOVA apontou que tanto a esp&eacute;cie da abelha como a &eacute;poca de coleta influenciaram significativamente nos teores de fen&oacute;is totais, de flavonoides e na capacidade antirradicalar da geopr&oacute;polis</strong>. Adicionalmente, a an&aacute;lise multivariada agrupou as geopr&oacute;polis por esp&eacute;cie de abelha, indicando que, <strong>para uma mesma regi&atilde;o geogr&aacute;fica, a composi&ccedil;&atilde;o qu&iacute;mica dos extratos da geopr&oacute;polis &eacute; determinada pela esp&eacute;cie de abelha nativa</strong>.</p>','http://rvq-sub.sbq.org.br/index.php/rvq/article/view/1235/681','Produtividade','Geoprópolis; meliponíneos; meliponicultura; variabilidade química; quimiometria; controle de qualidade.','Danielle V. Cardozo,a\r\n João B. Mokochinski,b\r\n Christiane S. Machado,a\r\nAlexandra Christine Helena F. Sawaya,b\r\n Isis K. Caetano,a\r\n Maria Lurdes\r\nFelsner,a\r\n Yohandra R. Torresa,*',1,'2020-04-09 19:41:50','2020-04-11 21:13:45',NULL),(9,'Modelos de colmeias racionais para a criação de mandaçaia (Melipona quadrifasciata quadrifasciata L.)','<p><strong>Meliponicultura e o valor das abelhas sem ferr&atilde;o</strong></p>\r\n\r\n<p>A cria&ccedil;&atilde;o de abelhas nativas &eacute; uma atividade muito importante no contexto florestal. Isto porque estes insetos ocupam uma posi&ccedil;&atilde;o de destaque entre os agentes polinizadores. Suas habilidades como produtoras de mel e recursos como cera e geopr&oacute;polis s&atilde;o t&atilde;o importantes como os servi&ccedil;os ambientais prestados. Geopr&oacute;polis &eacute; um tipo de pr&oacute;polis contendo resina, cera e solo, coletadas pelas abelhas sem ferr&atilde;o e utilizada na medicina popular devido &agrave;s suas propriedades antimicrobianas (CUNHA et al., 2013).</p>\r\n\r\n<p>A meliponicultura &eacute; uma atividade integradora da silvicultura com os ecossistemas naturais que contribui sinergicamente para a conserva&ccedil;&atilde;o de recursos e para a produ&ccedil;&atilde;o vegetal. Ela promove o uso de sistemas agr&iacute;colas mistos, contribuindo significativamente para a manuten&ccedil;&atilde;o da biodiversidade e de pr&aacute;ticas respons&aacute;veis, resultando em benef&iacute;cios como a redu&ccedil;&atilde;o de agroqu&iacute;micos.</p>\r\n\r\n<p>O decl&iacute;nio da popula&ccedil;&atilde;o de abelhas (POTTS et al., 2010) registrado em todos os continentes &eacute; um alerta de que devemos trazer o foco de nossa dedica&ccedil;&atilde;o cient&iacute;fica para as quest&otilde;es t&eacute;cnicas envolvendo estes insetos. Estudos b&aacute;sicos, como sistem&aacute;tica, distribui&ccedil;&atilde;o e ecologia, s&atilde;o necess&aacute;rios, bem como estudos aplicados que envolvam aspectos produtivos das abelhas nos aspectos de produ&ccedil;&atilde;o de mel e derivados e em servi&ccedil;os ambientais como na produ&ccedil;&atilde;o e dispers&atilde;o de sementes. [...]</p>','https://ainfo.cnptia.embrapa.br/digital/bitstream/item/147857/1/CT-383-Guilherme-Schuhli.pdf','Meliponicultura',NULL,'Katia Regina Ostrovski Tomporoski\r\nJoão Ricardo Dittrich\r\nGuilherme Schnell e Schühli',1,'2020-04-16 04:17:09','2020-04-16 04:17:09',NULL),(10,'PRINCIPAIS CARACTERÍSTICAS DE MÉIS DE ABELHAS NATIVAS SEM FERRÃO','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Os melipon&iacute;neos, tamb&eacute;m denominados de abelhas nativas sem ferr&atilde;o ou abelhas ind&iacute;genas, apresentam import&acirc;ncia para os bioamos onde ocorrem, incluindo a Caatinga, visto que s&atilde;o agentes de poliniza&ccedil;&atilde;o de muitas esp&eacute;cies vegetais nativas. Al&eacute;m disso, atrav&eacute;s da meliponicultura &eacute; poss&iacute;vel extrair, de forma sustent&aacute;vel, v&aacute;rios produtos dessas abelhas como o p&oacute;len, a geopr&oacute;polis e o mel, que tem alcan&ccedil;ado pre&ccedil;os elevados no mercado. Considerando-se a import&acirc;ncia dessas esp&eacute;cies, objetivou-se discorrer acerca das principais caracter&iacute;sticas do mel produzido pelas abelhas sem ferr&atilde;o, assim como incluir informa&ccedil;&otilde;es relacionadas com as principais esp&eacute;cies de melipon&iacute;neos e processamento do produto mais nobre produzido por elas, o mel. De acordo com os resultados da consulta bibliogr&aacute;fica, percebeu-se que existem grandes diferen&ccedil;as em rela&ccedil;&atilde;o &agrave; composi&ccedil;&atilde;o f&iacute;sico-qu&iacute;mica dos m&eacute;is de abelhas nativas em compara&ccedil;&atilde;o aos m&eacute;is de abelhas Apis mellifera, especialmente em rela&ccedil;&atilde;o ao conte&uacute;do de umidade, s&oacute;lidos insol&uacute;veis, acidez livre que se apresentam mais elevadas nos primeiros m&eacute;is, enquanto que a atividade diast&aacute;sica e a a&ccedil;&uacute;cares redutores. Por isso muitos estudos investigativos t&ecirc;m sido conduzidos para propor a elabora&ccedil;&atilde;o de uma legisla&ccedil;&atilde;o espec&iacute;fica que trate dos padr&otilde;es de qualidade dos m&eacute;is de melipon&iacute;neos. Em rela&ccedil;&atilde;o &agrave; extra&ccedil;&atilde;o e processamento do mel, deve-se ter cuidado com a coleta, para n&atilde;o destruir a colm&eacute;ia das abelhas, assim como &eacute; recomenda a aplica&ccedil;&atilde;o de desumidifica&ccedil;&atilde;o e pasteuriza&ccedil;&atilde;o com o intuito de aumentar a vida &uacute;til do produto, visto que estes m&eacute;is apresentam elevado conte&uacute;do de umidade.</p>',NULL,'Produtividade','Meliponicultura, semiárido, composição físico-química.','Davyson Barbosa Duarte (1); Dyego da Costa Santos (2); Daniela Dantas de Farias Leite (2); Joabis\r\nNobre Martins (3); Rossana Maria Feitosa de Figueirêdo (2)',1,'2020-04-16 04:21:13','2020-04-16 04:21:13',NULL),(11,'SISTEMA DE CALEFAÇÃO PARA NINHOS DE ABELHAS-SEM-FERRÃO COM CONTROLE E LEITURA DE TEMPERATURA INTERNA POR SISTEMA REMOTO','<p>O decl&iacute;nio de polinizadores em todo o mundo demanda aten&ccedil;&atilde;o e a necessidade de se aprofundar os conhecimentos sobre estes insetos. O Brasil, possui aproximadamente 300, das 400 esp&eacute;cies existentes de abelhas-sem-ferr&atilde;o que &eacute; o grupo mais eficiente de polinizadores da flora brasileira, mas, apesar desta singularidade carece de incentivos para pesquisas para o manejo e preserva&ccedil;&atilde;o destes insetos. Neste estudo foi desenvolvido um sistema de aquecimento, via resist&ecirc;ncia el&eacute;trica comandada por termostato digital adaptado a caixas de cria&ccedil;&atilde;o racional com a inten&ccedil;&atilde;o de, pelo calor, incentivar a multiplica&ccedil;&atilde;o de ninhos voltados para poliniza&ccedil;&atilde;o. No interior das caixas foram implantados sensores de temperatura e umidade, conectados a um microcontrolador, que enviava os dados, via wi-fi, para um servidor em nuvem cujos dados poderiam ser acessados por qualquer aparelho com conex&atilde;o online. O experimento foi montado no Centro de Ci&ecirc;ncias Agr&aacute;rias da UFSC em Florian&oacute;polis-SC, ao lado de uma mata em est&aacute;gio avan&ccedil;ado de regenera&ccedil;&atilde;o. Os dados foram coletados em seis caixas, cada uma contendo um ninho de Plebeia droryana, os quais foram submetidos a dois tratamentos: com temperatura controlada para ficar pr&oacute;xima a 30&ordm;C (sistema aquecido), e com as condi&ccedil;&otilde;es t&eacute;rmicas naturais (sistema controle). Foi desenvolvida uma plataforma, para acesso livre dos dados. Os componentes eletr&ocirc;nicos usados foram todos de baixo custo e acess&iacute;vel no mercado mundial. No sistema controle a umidade relativa foi superior &agrave; observada no sistema aquecido e a temperatura ambiente esteve correlacionada &agrave; temperatura interna dos ninhos. A umidade do sistema aquecido ficou sempre abaixo da umidade do ambiente externo. No sistema controle, a temperatura interna e externa variou na casa de 2&ordm;C, ou seja, compar&aacute;vel ao ambiente natural de nidifica&ccedil;&atilde;o dentro de fendas ou &aacute;rvores em ambiente natural. O volume dos ninhos decresceu no sistema aquecido. Este estudo ressalta a import&acirc;ncia da umidade relativa de ar no bem-estar desta esp&eacute;cie. Os resultados obtidos sugerem que o sistema de aquecimento deve ser aprimorado para evitar baixar a umidade relativa do ar. Al&eacute;m do baixo custo, a disponibiliza&ccedil;&atilde;o do software permitir&aacute; melhorias no sistema que poder&atilde;o proporcionar novos estudos e avan&ccedil;o na meliponicultura.</p>','https://repositorio.ufsc.br/xmlui/bitstream/handle/123456789/179779/349738.pdf?sequence=1&isAllowed=y','Manejo e Estrutura','Meliponídeos. Sensoriamento. Aquecimento. Umidade. Temperatura.','Jesus, Felipe Thiago de',1,'2020-04-16 04:27:56','2020-04-16 04:29:59',NULL),(12,'A REDUÇÃO NA DISPONIBILIDADE DE RECURSOS FLORAIS AUMENTA O TEMPO DE FORRAGEAMENTO DE ABELHAS SEM FERRÃO (Melipona subnitida, Apidae, Meliponini)','<p>A disponibilidade de recursos florais ao redor dos ninhos molda as atividades tanto internas como externas das col&ocirc;nias de abelhas sociais. Al&eacute;m de limitar a quantidade de recursos coletados, a disponibilidade de recursos florais no ambiente pode influenciar na dist&acirc;ncia percorrida pelas abelhas forrageiras durante a coleta de alimento. &Agrave; medida que os recursos florais se tornam escassos, as abelhas s&atilde;o mais propensas a usar recursos mais distantes e, consequentemente, expandem sua dist&acirc;ncia de voo em busca de novas fontes florais. A regi&atilde;o semi&aacute;rida do nordeste brasileiro, a Caatinga, possui uma breve esta&ccedil;&atilde;o chuvosa com alta disponibilidade de recursos florais e, em contraste, uma esta&ccedil;&atilde;o seca com apenas algumas esp&eacute;cies arb&oacute;reas em flora&ccedil;&atilde;o. Considerando o contraste na disponibilidade de recursos florais ao longo do ano nessa regi&atilde;o, o objetivo do presente estudo foi avaliar o tempo que as abelhas forrageiras da abelha Melipona subnitida gastam na coleta de alimento (n&eacute;ctar e p&oacute;len) durante os per&iacute;odos com alta e baixa riqueza de plantas em flora&ccedil;&atilde;o. Foi investigado o tempo que as abelhas forrageiras gastam para coletar recursos florais em tr&ecirc;s paisagens do nordeste brasileiro: uma &aacute;rea urbana, uma &aacute;rea com vegeta&ccedil;&atilde;o natural de caatinga, ambas em Mossor&oacute;/RN e um Brejo de Altitude, em Martins/RN. Durante o estudo (junho de 2015 a agosto de 2016) foi registrado mensalmente o n&uacute;mero de esp&eacute;cies de plantas em flora&ccedil;&atilde;o em cada ambiente. Mensalmente (um dia a cada m&ecirc;s), foi cronometrado o tempo de forrageamento de abelhas previamente marcadas para identifica&ccedil;&atilde;o individual, provenientes de tr&ecirc;s col&ocirc;nias de M. subnitida em cada local de estudo, registrando os hor&aacute;rios de sa&iacute;da e entrada de abelhas forrageiras, no per&iacute;odo entre 05:00 h e 08:00 h da manh&atilde;. Al&eacute;m disso, o respectivo recurso coletado (n&eacute;ctar ou p&oacute;len) foi identificado por meio da an&aacute;lise do p&oacute;len nas corb&iacute;culas ou no corpo dos indiv&iacute;duos. Os resultados indicam que a quantidade de recursos florais dispon&iacute;vel ao redor dos ninhos influenciou o tempo gasto na coleta de alimento. Quanto menor a disponibilidade de recursos maior foi o tempo gasto pelas abelhas durante o forrageamento. Isso implica em um maior gasto energ&eacute;tico para abelha, pois na aus&ecirc;ncia de recursos pr&oacute;ximos ao ninho a abelha ter&aacute; que se deslocar para &aacute;reas distantes.</p>','http://repositorio.ufersa.edu.br/bitstream/prefix/836/1/JaciaraSP_DISSERT.pdf','Produtividade','Coleta de recursos. Abelhas sem ferrão. Jandaíra. Disponibilidade de recursos florais. Caatinga','JACIARA DA SILVA PEREIRA',1,'2020-04-16 04:32:36','2020-04-16 04:32:36',NULL),(13,'Elaboração e análise de viabilidade econômica de um plano de negócios para a produção de mel de abelhas-sem-ferrão no município de Imbituba- SC','<p>O presente trabalho teve como objetivo elaborar e analisar a viabilidade econ&ocirc;mica de um plano de neg&oacute;cios para a produ&ccedil;&atilde;o de mel de abelhas-sem-ferr&atilde;o no munic&iacute;pio de Imbituba, em Santa Catarina. Para tal estudo foram coletados dados prim&aacute;rios e secund&aacute;rios. Elaborou-se ent&atilde;o um plano de neg&oacute;cios contendo as seguintes etapas: I) Sum&aacute;rio Executivo, II) Descri&ccedil;&atilde;o da empresa, III) Localiza&ccedil;&atilde;o e infraestrutura, IV) Equipe gerencial, V) Produtos e servi&ccedil;os, VI) An&aacute;lise de mercado, VII ) Plano de marketing, VIII) An&aacute;lise estrat&eacute;gica e IX) An&aacute;lise financeira. O investimento inicial para a implanta&ccedil;&atilde;o do projeto foi estimado em R$ 30.196,00, os custos anuais ficaram em torno de R$ 52.243,50 e a receita bruta anual &eacute; de R$ 69.720,00. A viabilidade econ&ocirc;mica foi analisada pelos indicadores: Taxa Interna de Retorno (TIR); o Payback; Valor Presente L&iacute;quido (VPL) e a Rela&ccedil;&atilde;o Beneficio/Custo. Tamb&eacute;m foi realizada a An&aacute;lise de Sensibilidade para o investimento. Constatou-se que o projeto para implanta&ccedil;&atilde;o de um melipon&aacute;rio em Imbituba &eacute; economicamente vi&aacute;vel, pois o VPL obtido foi de R$ 52.941,13, a TIR foi de 57%, a rela&ccedil;&atilde;o Benef&iacute;cio/Custo obtida&nbsp;foi 1,20 e o tempo de retorno do investimento para o projeto ficou em 1 ano e 7 meses.</p>','https://repositorio.ufsc.br/bitstream/handle/123456789/159744/BRUNA%20RAFAELA%20PACHECO.pdf?sequence=1&isAllowed=y','Empreendedorismo','meliponicultura, abelhas nativas, viabilidade econômica.','Bruna Rafaela Pacheco',1,'2020-04-16 04:34:48','2020-04-16 04:36:20',NULL),(14,'Como obter enxames de abelhas sem ferrão na natureza?','<p>&nbsp; &nbsp; &nbsp; Como atrair estes enxames de modo a poder utiliz&aacute;-los na meliponicultura? Alguns meliponicultores tiveram a id&eacute;ia de preparar ninhos-isca ou ninhos-armadilha para fornecer locais de nidifica&ccedil;&atilde;o e estimular a prepara&ccedil;&atilde;o de enxames nas col&ocirc;nias fortes. Descreveremos a seguir estes ninhos-armadilha e falaremos de nossa experi&ecirc;ncia no assunto.<br />\r\n<br />\r\nOs ninhos-armadilhas usados na meliponicultura s&atilde;o recipientes cuja finalidade &eacute; simular locais de nidifica&ccedil;&atilde;o natural para que os novos enxames ali se instalem e seja poss&iacute;vel seu transporte e transfer&ecirc;ncia para os melipon&aacute;rios. S&atilde;o normalmente confeccionados de garrafas pl&aacute;sticas tipo pet e apresentam algum atrativo para as abelhas no seu interior, como pr&oacute;polis, mel ou cera. Atualmente de acordo com uma resolu&ccedil;&atilde;o do Conselho Nacional do Meio Ambiente (CONAMA) de Agosto de 2004, essa &eacute; a &uacute;nica forma permitida para obten&ccedil;&atilde;o de col&ocirc;nias de abelhas Meliponini nativas diretamente da natureza. Os ninhos-armadilha ou garrafas-isca j&aacute; s&atilde;o bastante utilizados por meliponicultores de todo o Brasil, no entanto os m&eacute;todos empregados s&atilde;o muito diversos e muitas vezes sem comprova&ccedil;&atilde;o de sucesso. H&aacute; algumas varia&ccedil;&otilde;es sobre a maneira de confeccionar as armadilhas pelos criadores, mas a maioria dessas armadilhas &eacute; feita de garrafas pl&aacute;sticas PET de refrigerante com furos na parte inferior envolta por jornal e saco pl&aacute;stico. As mais simples s&atilde;o fechadas pela sua tampa, na qual &eacute; feito um orif&iacute;cio que se transforma na entrada do ninho. Este conjunto geralmente &eacute; envolto por saco pl&aacute;stico preto (figura 1). Um tipo um pouco mais sofisticado &eacute; feito colocando na garrafa PET um cotovelo de PVC (figura 2) que &eacute; utilizado como entrada do ninho. Com o intuito de aumentar a atratividade da armadilha, este cotovelo &eacute; previamente lavado com extrato de pr&oacute;polis e cera de abelha ou com cera de abelha misturada com &oacute;leo de soja. A figura 3 comprova a efici&ecirc;ncia dessa estrat&eacute;gia. Outros meliponicultores utilizam embalagens de leite longa-vida e os relatos de sucesso s&atilde;o, principalmente, na instala&ccedil;&atilde;o de Jata&iacute; (Tetragonisca angustula) e Mirim (Plebeia sp).</p>','http://www.apacame.org.br/mensagemdoce/100/artigo6.htm','Meliponicultura',NULL,'Ricardo Caliari Oliveira1, Cristiano Menezes1, Raphael Antonio de Oliveira Silva1, Ademilson Espencer Egea Soares2, Vera Lúcia Imperatriz Fonseca1',1,'2020-04-19 02:18:18','2020-04-19 02:18:18',NULL),(15,'CONSTITUINTES FENÓLICOS E ATIVIDADE ANTIOXIDANTE DA GEOPRÓPOLIS DE DUAS ESPÉCIES DE ABELHAS SEM FERRÃO AMAZÔNICAS','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;A geopr&oacute;polis &eacute; um produto resinoso produzido pelas abelhas, inclusive pelas esp&eacute;cies Melipona interrupta e Melipona seminigra, a partir da coleta de resinas vegetais, &oacute;leos essenciais, p&oacute;len, cera e a&ccedil;&uacute;cares, que &eacute; utilizado na constru&ccedil;&atilde;o e calafeta&ccedil;&atilde;o da colmeia.1,2 Tem cor variada de verde, vermelho para marrom escuro, apresenta um aroma caracter&iacute;stico e propriedades adesivas, porque interage fortemente com &oacute;leos e prote&iacute;nas da pele.3 Tem sido utilizada na medicina popular h&aacute; milhares de anos, devido &agrave;s propriedades biol&oacute;gicas que a pr&oacute;polis tem, tais como, anti-inflamat&oacute;ria, antibacteriana,4,5 antif&uacute;ngica,6 antioxidante,7-9 hepato-protetora, antiviral, capacidade de aumentar a resist&ecirc;ncia natural do corpo a infec&ccedil;&otilde;es e tratar &uacute;lcera gastroduodenal.10 V&aacute;rios estudos registraram que a atividade biol&oacute;gica da pr&oacute;polis depende da composi&ccedil;&atilde;o qu&iacute;mica, a qual tamb&eacute;m depende da diversidade geogr&aacute;fica e da variedade gen&eacute;tica da rainha.11 Como a pr&oacute;polis apresenta v&aacute;rias atividades biol&oacute;gicas, em sua composi&ccedil;&atilde;o qu&iacute;mica constam muitos produtos naturais bioativos como polifen&oacute;is, flavonoides e &eacute;steres do &aacute;cido cafeico.12,13 &Eacute; extremamente dif&iacute;cil identificar qual a subst&acirc;ncia respons&aacute;vel por sua atividade terap&ecirc;utica, uma vez que existe uma diversidade muito grande de componentes presentes na pr&oacute;polis. Alguns autores afirmam que sua efic&aacute;cia estaria justamente na composi&ccedil;&atilde;o qu&iacute;mica heterog&ecirc;nea.14 Entre os grupos biologicamente ativos mais importantes descritos na pr&oacute;polis, est&atilde;o os compostos fen&oacute;licos, onde podemos destacar os &aacute;cidos g&aacute;lico, van&iacute;lico, fer&uacute;lico, p- -cum&aacute;rico, &eacute;ster fenet&iacute;lico do &aacute;cido cafeico (CAPE), &aacute;cidos cafeico e siring&iacute;co, que s&atilde;o comuns em produtos ap&iacute;colas.15 Outro grupo de compostos fen&oacute;licos encontrado na pr&oacute;polis s&atilde;o os flavonoides. Dentre eles podemos destacar alguns flavon&oacute;is: galangina, campeferol, quercetina, miricetina, algumas flavonas: crisina, apigenina, luteolina, tectocrisina, e as flavanonas: pinocembrina, isosacuranetina, naringenina [...]</p>',NULL,'Produtividade',NULL,'Ellen Cristina Costa da SilvaI, *; Magno Perêa MunizI; Rita de Cássia Saraiva Nunomura I; Sergio Massayoshi Nunomura II; Gislene Almeida Carvalho Zilse III',1,'2020-04-26 04:05:07','2020-04-26 04:05:18',NULL);
