INSERT INTO `faqs` VALUES (1,'Quantos dias depois de identificar a captura posso passar para a caixa?','<p>Depois de identifiaca a captura deve-se esperar 40 dias para efetuar a transfer&ecirc;ncia para a caixa.</p>',1,'0000-00-00 00:00:00','2020-04-11 20:35:41',NULL),(2,'Como posso fazer atrativo para abelhas sem ferrão?','<p>Para a produ&ccedil;&atilde;o do atrativo deve-se utilizar dos seguintes itens abaixo.</p>\r\n\r\n<ul>\r\n	<li>1 garrafa pet</li>\r\n	<li>300G de&nbsp;cera/pr&oacute;polis</li>\r\n	<li>700ML de &aacute;lcool&nbsp;92% (&eacute; poss&iacute;vel fazer com &aacute;lcool 70%, por&eacute;m demora mais tempo para a cera/pr&oacute;polis dissolver).</li>\r\n	<li>Aguarte at&eacute; dissolver completamente</li>\r\n</ul>\r\n\r\n<p>e estar&aacute; pronto seu atrativo.</p>',1,'2020-04-11 20:38:53','2020-04-11 20:43:55',NULL),(3,'Como fazer alimentação artificial para abelhas sem ferrão?','<p>A alimenta&ccedil;&atilde;o artificial para asf &eacute; feita com os seguintes itens abaixo:</p>\r\n\r\n<ul>\r\n	<li>&Aacute;gua</li>\r\n	<li>A&ccedil;ucar</li>\r\n	<li>Mel</li>\r\n	<li>Capim cidreira</li>\r\n	<li>Ferva tudo por 5 minutos e reserve na geladeira at&eacute; alimentar as asf.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>',1,'2020-04-11 20:47:17','2020-04-11 20:47:17',NULL);
